"use client";
import { NavData } from "@/constants";
import Link from "next/link";
import React, { useState } from "react";
import { FaShoppingCart } from "react-icons/fa";
import { IoIosMenu, IoMdClose } from "react-icons/io";
import horizon from "@/lib/horizon";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <>
      {/* Desktop view */}
      <div className="bg-[#151515] h-14 md:flex justify-between items-center sticky top-0 z-10 w-full hidden">
        <div className="flex items-center justify-center px-6 gap-6">
          <p
            className={`text-sm font-extrabold bg-gradient-to-r from-[#E94DA1] to-[#B4C8F2] text-transparent bg-clip-text text-center${horizon.className}`}
          >
            BEAT PASAL
          </p>
          <div className="flex gap-4">
            {NavData.map((item, index) => (
              <div key={index} className="flex items-center">
                <Link href={item.href} className="text-white font-bold text-sm">
                  {item.name}
                </Link>
                {item.more && (
                  <p className=" bg-gradient-to-r from-[#F03F98] to-[#B5C8F2] text-transparent bg-clip-text text-[10px] mb-3 ml-1">
                    {item.more}
                  </p>
                )}
              </div>
            ))}
          </div>
        </div>
        <div className="text-white flex mr-16 gap-6 items-center">
          <Link href="/signup" className="text-sm">
            Sign Up
          </Link>
          <Link href="/login" className="text-sm">
            Log In
          </Link>
          <FaShoppingCart size={18} />
        </div>
        {/* Menu */}
        {/* Hamburger */}
        <div className="block md:hidden">
          {!isOpen ? (
            <div onClick={() => setIsOpen(!isOpen)}>
              <IoIosMenu size={30} color="white" />
            </div>
          ) : (
            <IoMdClose
              className="absolute top-10 right-5 "
              size={30}
              color="white"
              onClick={() => setIsOpen(!isOpen)}
            />
          )}
        </div>
      </div>
      {/* Desktop view */}

      {/* Mobile view */}
      <div></div>
      {/* Mobile view */}
    </>
  );
};

export default Navbar;
